import './../screens/CommonStyle.css';
import {Route, Router, Routes} from "react-router-dom";
import MainPage from "../screens/MainPage";

function Navigation() {
    return(
        <Router>
            <Routes>
                <Route path="/" element={<MainPage />} />
            </Routes>
        </Router>
    )
}

export default Navigation;
